description:
The Football League Show 02.11.2013

Duration: 1 hour, 20 min

Manish Bhasin presents all the drama from all three divisions of the Football League, as teams return to action after the international break. The featured match sees Wigan entertain Brighton, and two clubs at the wrong end of the table go head-to-head as Doncaster meet Yeovil. Plus the best of the action from the Yorkshire derby between Sheffield Wednesday and Huddersfield.
